import "./PhotoShowcase.css";
function Title({text}){
    return (
        <h3 >
            {text}
        </h3>
    )
}
function Photo({url}){
    return(
    <img className="showcase-photo  md:w-fit border-8 border-purple-abyss m-2 rounded" src={url}/>

    )
}

export default function PhotoShowcase({}){

return(
        <>
            <div className="m-8 bg-green-400 h-fit flex flex-col justify-between items-center p-4">
                <div className="text-3xl text-purple-abyss font-black w-3/4 underline">
                    <Title className="" text="Check out these phunky shots!"/>
                </div>
                <div className="w-fit h-screen flex flex-col items-center justify-between h-fit md:flex-row">
                    <Photo id="image-1" url="https://u.cubeupload.com/bostonessary/1.jpg"/>

                    <Photo url={"https://u.cubeupload.com/bostonessary/2.jpg"}/>
                    <Photo url={"https://u.cubeupload.com/bostonessary/3.jpg"}/>
                </div>
            </div>
        </>
    )
}
